import './Nav.css'
import myImage from './assets/images/logo192.png' 

function Nav () {
    return (
        <nav>

                <img src={myImage} alt="React Icon" />
                <h2>ReactFacts</h2>

            <h3>React Course - Project 1</h3>
        </nav>
    )
}

export default Nav;
